		Collection<ProfileEntry> avail = profile.getAvailability(startTime, endTime);
		long units = 0;
		Iterator<ProfileEntry> it = avail.iterator();
		ProfileEntry prev = it.next();

		while (it.hasNext()) {
			ProfileEntry curr = it.next();

			if (curr.getTime() < startTime) {
				prev = curr;
